"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?20/53/21334/contributors\">",
"     Karen M Schneider, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?20/53/21334/contributors\">",
"     Section Editors",
"    </a>",
