" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Classification of the hematopoietic neoplasms",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?20/53/21337/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?20/53/21337/contributors\">",
"     Arnold S Freedman, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?20/53/21337/contributors\">",
"     Jonathan W Friedberg, MD",
"    </a>",
