"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?20/53/21337/contributors\">",
"     Jon C Aster, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?20/53/21337/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?20/53/21337/contributors\">",
"     Andrew Lister, MD, FRCP, FRCPath, FRCR",
"    </a>",
"    <br/>",
